import React from "react";
import "../../App.css";
import Footer from "../Footer";
import "../Cards.css";
import CardItem from "../CardItem";

export default function Services() {
  return (
    <div>
      {/* <h1 className="services">SERVICES</h1> */}
      <h1>Services</h1>
      <div style={{ width: 300, height: 100 }}>
        <div className="cards__container">
          <div className="cards__wrapper">
            <ul className="cards__items">
              <CardItem
                src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRfjo_mRD2WtyLQkE9p9GJLhWapjAjRHd5fXQ&usqp=CAU"
                text="Load new words onto the device with our service here"
                label="Custom Words & Images"
                path="/services"
              />
              <CardItem
                src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR62Ye2YTQqGErSkeAcj-0ZceMxg_10AltAkQ&usqp=CAU"
                text="Upload the preloaded words and images for the device here"
                label="Preset Words & Images"
                path="/services"
              />
            </ul>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  );
}
